function renderRecords_Config(transaction, results) {
    console.debug('called renderRecords_Config()');

    dataset = results.rows;
    
    if (dataset.length > 0) {
        for (var i = 0, item = null; i < dataset.length; i++) {
            item = dataset.item(i);
            var id_usuario = parseInt(item['valor'],10);

            if(id_usuario >0){
                location.href="tomarfoto.html?id=" + id_usuario+ "&seccion=tomarfoto";
            }else{
                deleteRecords_Config();
                
                setTimeout(function(){
                    location.href="login.html";
                },500);
                
            }
        }

    }else{
        deleteRecords_Config();
                
        setTimeout(function(){
            location.href="login.html";
        },500);
    }
}


